import "./rain.css"
import "./rain"
const Rain =() =>{
    return(
        <>
            <div className="rain front-row"></div>
            <div className="rain back-row"></div>
            <div className="toggles">
                <div className="back-row-toggle toggle active">BACK<br/>ROW</div>
            </div>
        </>
    )
}

export default Rain;
